import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import Lead from './Lead';
import FrontContent from './FrontContent';

class FrontPage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <React.Fragment>
                <Lead/>
                <FrontContent/>
            </React.Fragment>
        );
    }
}

export default withRouter(FrontPage);
